import React from "react";
import Tilt from "react-tilt";
import Brain from "./Brain.png";
import "./Logo.css";

const Logo = () => {
  return (
    <div className="ma4 mt0">
      <Tilt
        className="Tilt br2 shadow-2"
        options={{ max: 55 }}
        style={{ height: 150, width: 150 }}
      >
        <div className="Tilt-inner pa3">
          <img
            style={{
              paddingTop: "10px",
              width: "80px",
              height: "80px",
              alignItems: "center",
              marginTop: "10px",
            }}
            src={Brain}
            alt="logo"
          ></img>
        </div>
      </Tilt>
    </div>
  );
};

export default Logo;
